module.exports = secondLevel;

secondLevel.$inject = ['PluS_express'];
function secondLevel(express) {
  var exp = {}
  exp.start = start;
  
  function start() {
    var app = express.app;
  
    app.get('/secondlevel', function (req, res) {
      res.send('Everything is a PLUGIN'); 
    });
  }
  
  return exp;
}
